        file.write(struct.pack('>i', 0)) # rate (k30_fps)

        # draw stuff
        file.write(struct.pack('>i', 3)) # draw version
        file.write(struct.pack('>c', b'\x01')) # isShowing
        file.write(struct.pack('>fff', 0.0, 0.0, 0.0)) # drawSphereX, drawSphereY, drawSphereZ
        file.write(struct.pack('>f', 0.0)) # drawSphereRadius
        file.write(struct.pack('>f', 0.0)) # drawOrder

        # trans stuff
        file.write(struct.pack('>i', 9)) # version
        for i in range(2): # local and world XFM
            file.write(struct.pack('>fff', 1.0, 0.0, 0.0))
            file.write(struct.pack('>fff', 0.0, 1.0, 0.0))
            file.write(struct.pack('>fff', 0.0, 0.0, 1.0))
            file.write(struct.pack('>fff', 0.0, 0.0, 0.0))
        file.write(struct.pack('>i', 0)) # constraint
        file.write(struct.pack('>i', 0)) # target
        file.write(struct.pack('>c', b'\x00')) # preserveScale
        file.write(struct.pack('>i', 0)) # parent

        file.write(struct.pack('>i', 0)) # environ count
        file.write(struct.pack('>i', 0)) # test event count

        # lod targets
        file.write(struct.pack('>i', 0)) # lod target count (we dont want LODs)

        file.write(struct.pack('>i', 0)) # shadow count
        file.write(struct.pack('>c', b'\x00')) # self_shadow

        str_bytes = exporter.directory_name.encode('utf-8') # todo: replace with something unique
        file.write(struct.pack('>i', len(str_bytes)))
