        # calculate and write bounding box
        bbox_corners = [obj.matrix_world @ Vector(corner) for corner in obj.bound_box]
        bbox_center = sum(bbox_corners, Vector()) / 8
        bbox_radius = max((corner - bbox_center).length for corner in bbox_corners)
        file.write(struct.pack('>fff', bbox_center[0], bbox_center[1], bbox_center[2]))
        file.write(struct.pack('>f', bbox_radius))

        file.write(struct.pack('>c', b'\x00')) # frozen

        file.write(struct.pack('>i', -1)) # force LOD (kLODPerFrame)

        file.write(struct.pack('>i', 0)) # unknown grp

        # char_test stuff
        file.write(struct.pack('>i', 15)) # char_test version
        file.write(struct.pack('>i', 0)) # driver
        file.write(struct.pack('>i', 0)) # clip1
        file.write(struct.pack('>i', 0)) # clip2
        file.write(struct.pack('>i', 0)) # teleport_to
