from bpy_extras.io_utils import ExportHelper
from bpy.types import Operator

class ExportMesh(Operator, ExportHelper):
    """Export to Milo Scene"""
    bl_idname = "export_mesh.milo_scene"
    bl_label = "Milo Export"
    filename_ext = ".milo"

    # main props

    export_trans: bpy.props.BoolProperty(
        name="Export Trans Bones",
        description="Export bone transforms as Trans objects. Allows creating full characters.",
        default=True,
    )

    pseudorb1: bpy.props.BoolProperty(
        name="Mesh uses pseudo-Rock Band 1 format",
        description="The mesh will be versioned as pseudo-Rock Band 1 and will only work in Rock Band 3",
        default=True,
    )
    
    platform: bpy.props.EnumProperty(
        name="Platform",
        description="The platform of the Milo scene",
        items=[
            ('XBOX 360', "Xbox 360", "Xbox 360"),
            ('PS3', "PS3", "PS3"),
            ('Wii', "Wii", "Wii")
        ],
        default='XBOX 360',
    )

    awesomeness_detection: bpy.props.BoolProperty(
        name="Awesomeness Detection",
        description="You know what this does",
        default=True,
    )

    # scene props

    note: bpy.props.StringProperty(
        name="Note",
        description="Some information about the scene. Unused by the game, but you can put your username or Discord or signature or whatever here",
        default="",
    )

    directory_name: bpy.props.StringProperty(
        name="Directory Name",
        description="The name of the Character directory that gets created",
        default="custom_character",
    )

    subdir_name: bpy.props.StringProperty(
        name="Sub-Directory Path",
        description="The path of the sub-directory that will get loaded as a child of this directory. Needed to make certain objects such as clothing not crash the game. This needs to be a !RELATIVE! Milo path (e.g. ../../shared/char_shared.milo)",
        default="",
    )


    def draw(self, context):
        layout = self.layout
        layout.prop(self, "export_trans")
        layout.prop(self, "pseudorb1")
        layout.prop(self, "platform")
        layout.prop(self, "awesomeness_detection")

        box = layout.box()
        box.label(text="Scene Properties", icon='NODETREE')
        box.prop(self, "directory_name")
        box.prop(self, "subdir_name")
        box.prop(self, "note")

            



    def execute(self, context):
        return export_mesh(context, self.filepath, self)
    
    def invoke(self, context, event):
        # Change the file extension based on the platform
        if self.platform == 'XBOX 360':
            self.filename_ext = ".milo_xbox"
        elif self.platform == 'PS3':
            self.filename_ext = ".milo_ps3"
        elif self.platform == 'Wii':
            self.filename_ext = ".milo_wii"

        # Call the original invoke function (important to bring up the file browser)
        return super().invoke(context, event)  # Important to bring up the file browser

def menu_func_export(self, context):
    self.layout.operator(ExportMesh.bl_idname, text="Export Milo Scene (.milo)")

def register():
    bpy.utils.register_class(ExportMesh)
    bpy.types.TOPBAR_MT_file_export.append(menu_func_export)

def unregister():
    bpy.utils.unregister_class(ExportMesh)
    bpy.types.TOPBAR_MT_file_export.remove(menu_func_export)

if __name__ == "__main__":
    register()